description:
Dans un quartier recherché à quelques minutes du centre ville, sur un terrain de 7 000 m2 environ, exposition plein sud pour cette maison de type bastide offrant une vue exceptionnelle sur la ville et les collines environnantes.

De plain-pied, vous trouverez :

- un séjour avec cheminée ;
- une cuisine indépendante donnant sur un belle véranda ;
- deux chambres ;
- une chambre et sa salle d'eau avec entrée indépendante mais accessible depuis la maison ;
- une salle de bain ;
- un toilette indépendant ;

Au premier étage :
- une chambre.

Une parcelle de terrain constructible est située sur la partie basse du terrain (détachement de parcelle déjà réalisée).

Très grand garage de 55 m2 environ, portail électrique, piscine, carport et climatisation dans le salon complètent les prestations de cette maison surplombant la cité du Dragon.
